import App from "./App";
import Favorites from "./Favorites";
import ErrorPage from "./ErrorPage";
import Books from "./Books";
import Request from "./Request";

const routes = [
  {
      path: "/",
      element: <App />,
      errorElement: <ErrorPage />,
      children: [
           {
              path: "/",
              element: <Books />
          }, 
          {
              path: "/about",
              element: <About />
          },
          {
              path: "/login",
              element: <Login />
          },
          {
              path: "/profile/:id",
              element: <UserProfile />
          }
      ]
  }
];

export default routes
